class Graph():
    def __init__(self, data:list):
        self.raw = data
        self.size = len(self.raw)
        self.startpoint = 0
        self.endpoint = len(data)-1
        self.linkdict = {}
        self.makeGraph()

    def makeGraph(self):
        for i in range(self.size):
            self.linkdict[i] = self.findLinkPoint(i)

    def findLinkPoint(self, index:int):
        diff_limit = self.raw[index]
        linkPoint = [index+x for x in range(-diff_limit, diff_limit+1) if x!= 0 and index+x>=0 and index+x<self.size]
        return linkPoint

class GraphSearch():
    def __init__(self, graph:Graph):
        self.graph = graph
        self.queue = []
        self.trashcan = []
        self.parentdict = {}
        self.route = []
        self.all = []


    def BFS(self):
        if self.graph.startpoint == self.graph.endpoint:
            return 0
        self.queue.append(self.graph.startpoint)
        while True:
            self.trashcan.append(self.queue[0])
            linkPoints = [x for x in self.graph.linkdict[self.queue[0]] if x not in self.trashcan and x not in self.queue]
            if self.graph.endpoint in linkPoints:
                parent_index = len(self.trashcan)-1
                break
            else:
                for y in range(len(linkPoints)):
                    self.parentdict[len(self.trashcan+self.queue)+y-1] = len(self.trashcan)-1
                self.queue += linkPoints
            self.queue = self.queue[1:]
            if self.queue == []:
                print("No Solution")
                return 0
        self.route.append(self.graph.endpoint)
        self.all = self.trashcan+self.queue
        while True:
            parent = self.all[parent_index]
            self.route.append(parent)
            if parent == self.graph.startpoint:
                break
            else:
                parent_index = self.parentdict[parent_index]


